import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      friends: [],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.friends.map((friend) => {
          return (
            <div key={friend.id}>
              <h1>{friend.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
